import { createApp } from 'vue'
import App from './App.vue'
const app = createApp(App);
//导入路由
import router from "@/router";

//导入mui
import "./lib/mui/js/mui"
import "./lib/mui/css/mui.css"
import "./lib/mui/fonts/mui.ttf"


app.use(router)


app.mount('#app')
